path: /home/pi/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

[include macros.cfg]
#[include chamber_leds.cfg]
[include led_effects.cfg]
[include test_speed.cfg]
[include btt_ebb36_pin_aliases.cfg]
